"GameOn" - Restrições de integridade
R1: Gerado pelo sistema;
R2: É obrigatoriamente um de "Ativo", "Inativo" ou "Banido";
R3: Alfanumérico de dimensão 10;
R4: URL para uma página com os detalhes do jogo;
R5: Sequencial
R6: 1 <= X <= 5;
R7: É obrigatoriamente um de "Por iniciar", "A aguardar jogadores, "Em curso" e "Terminada";
R8: Os jogadores têm de ser da região da partida para poderem jogar;
R9: URL para imagem do crachá;
NOTA: Assume-se a existência de um sistema que atualiza a pontuação e estado durante a execução do jogo.
